<item>
<title><![CDATA[Facebook estrena "Notify", la aplicación de noticias]]></title>

<link>http://www.lapagina.com.sv/internacionales/111952/2015/11/12/Facebook-estrena-Notify-la-aplicacion-de-noticias</link>
<author><![CDATA[DPA <info@lapagina.com >]]></author>
<guid isPermaLink="true">http://www.lapagina.com.sv/ampliar.php?id=111952</guid>
<pubDate>Thu, 12 Nov 2015 11:03:49 -0600</pubDate>
<description><![CDATA[<img align="right" hspace="10" alt="" src="http://www.lapagina.com.sv/mn/userfiles/antiguas/IHOV_Tk90aWZ5LmpwZw==.jpg"/><div><span style="font-family: Verdana;">Facebook estrenó hoy "Notify" en Estados Unidos, una aplicación de noticias con la que los usuarios podrán ajustar las noticias a sus principales intereses.</span></div>
<div><span style="font-family: Verdana;"><br />
</span></div>
<div><span style="font-family: Verdana;">Los que utilicen la aplicación podrán, por ejemplo, elegir sólo las noticias que más les interesan de determinados medios o incluso de temas y regiones.</span></div>
<div><span style="font-family: Verdana;"><br />
</span></div>
<div><span style="font-family: Verdana;">La aplicación avisa en la pantalla cuando surgen nuevas noticias de interés que luego se podrán leer ampliadas en la aplicación.</span></div>
<div><span style="font-family: Verdana;"><br />
</span></div>
<div><span style="font-family: Verdana;">Entre las más de 70 fuentes de noticias encontramos la cadena de televisión "CNN", diarios como "The New York Times" o el "Washington Post", y también las revistas "Time", "People" o "Vanity Fair".</span></div>
<div><span style="font-family: Verdana;"><br />
</span></div>
<div><span style="font-family: Verdana;">Facebook se introdujo en el mercado de los medios con la aplicación "Instant Articles", donde los usuarios tenían acceso a artículos publicados por las principales marcas de noticias y generadores de contenido multimedia sin tener que salir de la propia plataforma de la red social.</span></div>
<div><span style="font-family: Verdana;"><br />
</span></div>
<div><span style="font-family: Verdana;">Otras grandes compañías de Internet como Twitter, Google o Snapchat realizan grandes esfuerzos por mejorar su papel como plataforma para medios.</span></div>
<div><span style="font-family: Verdana;"><br />
</span></div>
<div><span style="font-family: Verdana;">Apple estrenó hace poco, y sólo en Estados Unidos, su propia aplicación de noticias para el iPhone, el teléfono de la compañía.</span></div>
<div> </div>
<div> </div>]]></description>

</item>
<item>
<title><![CDATA[Murió a los 85 años Andy White, el auténtico "quinto Beatle"]]></title>

<link>http://www.lapagina.com.sv/jetset/111950/2015/11/12/Murio-a-los-85-anos-Andy-White-el-autentico-quinto-Beatle</link>
<author><![CDATA[DPA <info@lapagina.com >]]></author>
<guid isPermaLink="true">http://www.lapagina.com.sv/ampliar.php?id=111950</guid>
<pubDate>Thu, 12 Nov 2015 10:55:33 -0600</pubDate>
<description><![CDATA[<img align="right" hspace="10" alt="" src="http://www.lapagina.com.sv/mn/userfiles/antiguas/ADUN_NV9iZWF0bGUuanBn.jpg"/><div><span style="font-family: Verdana;">El músico Andy White, que tocaba la batería en el hit de los Beatles "Love Me Do", murió el lunes a los 85 años en el estado de Nueva Jersey, informó CNN en base a declaraciones de su esposa, Thea.</span></div>
<div><span style="font-family: Verdana;"><br />
</span></div>
<div><span style="font-family: Verdana;">"Dios fue bueno con nosotros. Nos dio 42 años extraordinarios juntos", aseguró Thea White a la emisora. El baterista sufrió un ataque de apoplejía el pasado jueves. Su viuda afirmó que está aliviada de que su marido no haya sufrido.</span></div>
<div><span style="font-family: Verdana;"><br />
</span></div>
<div><span style="font-family: Verdana;">White, originario de Escocia, participó en la tercera grabación de "Love Me Do" de 1962. Según la revista "Rolling Stone", recibió en aquel momento cinco libras esterlinas por tres horas de trabajo, pero ningún porcentaje en las ventas de la canción.</span></div>
<div><span style="font-family: Verdana;"><br />
</span></div>
<div><span style="font-family: Verdana;">"Love Me Do" fue el primer single de los Beatles y tras su difusión en Estados Unidos en 1964 trepó hasta el primer puesto de las listas de éxitos.</span></div>
<div><span style="font-family: Verdana;"><br />
</span></div>
<div><span style="font-family: Verdana;">Varias personas suelen ser consideradas como el "quinto Beatle" por su vínculo estrecho con el cuarteto formado por John Lennon, Paul McCartney, George Harrison y Ringo Starr. Entre ellos se cuentan el bajista Stuart Sutcliffe, el baterista Pete Best, el mánager Brian Epstein e incluso la segunda mujer de Lennon, Yoko Ono.</span></div>
<div> </div>
<div> </div>]]></description>

</item>
<item>
<title><![CDATA[Inclusión Social anuncia carrera-caminata por la no violencia contra la mujer]]></title>

<link>http://www.lapagina.com.sv/nacionales/111949/2015/11/12/Inclusion-Social-anuncia-carrera-caminata-por-la-no-violencia-contra-la-mujer</link>
<author><![CDATA[Redacción Diario La Página <info@lapagina.com >]]></author>
<guid isPermaLink="true">http://www.lapagina.com.sv/ampliar.php?id=111949</guid>
<pubDate>Thu, 12 Nov 2015 10:48:00 -0600</pubDate>
<description><![CDATA[<img align="right" hspace="10" alt="" src="http://www.lapagina.com.sv/mn/userfiles/antiguas/NXEP_SW5jbHVzaW9uLmpwZw==.jpg"/><p><span style="font-family: Verdana;">La secretaría de Inclusión Social  anunció hoy la realización de la carrera-caminata "Por una vida libre  de violencia contra las mujeres", que se celebrará el próximo 29 de  noviembre y tendrá como punto de partida y llegada el parque Cuscatlán,  en San Salvador.</span></p>
<p><span style="font-family: Verdana;">  </span></p>
<p class="MsoNormal"> </p>
<p class="MsoNormal"> </p>
<p class="MsoNormal"><span style="font-family:"Verdana",sans-serif">&ldquo;Les  animo a que corramos y caminemos juntos como una experiencia ciudadana.  Queremos que nos acompañen niños, jóvenes, mujeres, hombres, personas  adultas mayores y personas con discapacidad&rdquo;, expresó la secretaria  Vanda Pignato.<br />
</span></p>
<p class="MsoNormal"><span style="font-family: Verdana;">La  funcionaria explicó que el objetivo de esta actividad es que sea una  expresión de la sociedad para reclamar porque las mujeres vivan en un  ambiente de paz y sin violencia.</span></p>
<p class="MsoNormal"><span style="font-family: Verdana;">Pignato recordó que las mujeres salvadoreñas <span style="font-family:"Verdana",sans-serif">&ldquo;no están protegidas ni en el hogar ni en la calle&rdquo;</span></span><span style="font-family: Verdana;">  y dijo que el bajo nivel de denuncias se da porque no hay una confianza  en el sistema judicial para que en estos casos se haga justicia.</span></p>
<p class="MsoNormal"><span style="font-family: Verdana;">Sobre  la carrera-caminata, explicaron que será el 29 de noviembre a las 7:00  de la mañana y que el punto de partida y llegada será el parque  Cuscatlán. Las distancias que se recorrerán son 1, 3 y 6 kilómetros, a  fin que todas las personas puedan participar.</span></p>
<p class="MsoNormal"><span style="font-family: Verdana;">Las categorías que se correrán son infanto juvenil, adulto y adulto mayor, tanto en masculino como en femenino.</span></p>
<p class="MsoNormal"><span style="font-family: Verdana;">Las  inscripciones serán el mismo día a partir de las 6:00 de la manaña y  habrá kits promocionales para las primeras mil personas inscritas</span><span style="font-family: Verdana;">.</span></p>
<p><span style="font-family: Verdana;"><br type="_moz" />
</span></p>]]></description>

</item>
<item>
<title><![CDATA[Condenan a 18 años de prisión a periodista y esposa que drogaron y asfixiaron a su hija]]></title>

<link>http://www.lapagina.com.sv/internacionales/111944/2015/11/12/Condenan-a-18-anos-de-prision-a-periodista-y-esposa-que-drogaron-y-asfixiaron-a-su-hija</link>
<author><![CDATA[DPA <info@lapagina.com >]]></author>
<guid isPermaLink="true">http://www.lapagina.com.sv/ampliar.php?id=111944</guid>
<pubDate>Thu, 12 Nov 2015 10:12:59 -0600</pubDate>
<description><![CDATA[<img align="right" hspace="10" alt="" src="http://www.lapagina.com.sv/mn/userfiles/antiguas/WABB_QXN1bnRhLmpwZw==.jpg"/><div><span style="font-family: Verdana;">La Justicia española condenó hoy a 18 años de prisión a cada uno de los padres adoptivos de una niña de 12 años de origen chino, cuya muerte conmocionó a España hace dos años.</span></div>
<div><span style="font-family: Verdana;"><br />
</span></div>
<div><span style="font-family: Verdana;">Según informó la prensa del país, la Audiencia Provincial de La Coruña (noroeste) les atribuyó un delito de asesinato con alevosía la circunstancia agravante de parentesco.</span></div>
<div><span style="font-family: Verdana;"><br />
</span></div>
<div><span style="font-family: Verdana;">El jurado popular del caso declaró hace unos días, por unanimidad, que la abogada Rosario Porto y el periodista Alfonso Basterra eran culpables de la muerte de la menor, que fue adoptada por la pareja cuando tenía un año.</span></div>
<div><span style="font-family: Verdana;"><br />
</span></div>
<div><span style="font-family: Verdana;">Ahora, la resolución judicial considera probado que decidieron matar a la niña, la pequeña Asunta Basterra, y que le suministraron una fuerte dosis de tranquilizantes para que no pudiera defenderse en el momento de asfixiarla.</span></div>
<div><span style="font-family: Verdana;"><br />
</span></div>
<div><span style="font-family: Verdana;">La sentencia recoge también que la víctima fue drogada repetidamente por sus padres con el mismo medicamento desde al menos tres meses antes de su muerte. Descarta, además, la posible participación de una tercera persona.</span></div>
<div><span style="font-family: Verdana;"><br />
</span></div>
<div><span style="font-family: Verdana;">El cadáver de la pequeña Asunta fue descubierto en la madrugada del 22 de septiembre de 2013 en una pista forestal cercana a Santiago de Compostela. Los únicos acusados fueron los padres adoptivos, que ingresaron en prisión días después.</span></div>
<div><span style="font-family: Verdana;"><br />
</span></div>
<div><span style="font-family: Verdana;">La autopsia reveló que Asunta había muerto por asfixia después de haberle sido suministrada una fuerte dosis de tranquilizantes.</span></div>
<div> </div>
<div> </div>]]></description>

</item>
<item>
<title><![CDATA[Cristiano Ronaldo se regala un jet de 19 millones de euros]]></title>

<link>http://www.lapagina.com.sv/deportes/111942/2015/11/12/Cristiano-Ronaldo-se-regala-un-jet-de-19-millones-de-euros</link>
<author><![CDATA[Agencias <info@lapagina.com >]]></author>
<guid isPermaLink="true">http://www.lapagina.com.sv/ampliar.php?id=111942</guid>
<pubDate>Thu, 12 Nov 2015 09:08:41 -0600</pubDate>
<description><![CDATA[<img align="right" hspace="10" alt="" src="http://www.lapagina.com.sv/mn/userfiles/antiguas/YRFW_Q1JfamV0LmpwZw==.jpg"/><div><span style="font-family: Verdana;">Recientemente se conocieron varias fotos de la nueva y lujosa adquisición del delantero del Real Madrid, Cristiano Ronaldo, quien se autoregaló un jet con capacidad para 10 personas.</span></div>
<div><span style="font-family: Verdana;"><br />
</span></div>
<div><span style="font-family: Verdana;">El periódico Mundo Deportivo destaca que la aeronave le costó al futbolista unos 19 millones de euros y al parecer será utilizado para cuestiones privadas a partir de esta semana.</span></div>
<div><span style="font-family: Verdana;"><br />
</span></div>
<div><span style="font-family: Verdana;">El medio deportivo español destaca que el modelo de la nave es un Gulfstream G200 y está equipado con unos interiores extraordinariamente lujosos. Cuenta con baño, vestuario, acceso a internet, teléfono, fax, cocina equipada con todo tipo de lujos, lector de CD y DVD.}</span></div>
<div><span style="font-family: Verdana;"><br />
</span></div>
<div><span style="font-family: Verdana;">El primer vuelo del CR jet fue de Madrid a Londres para el estreno de la película sobre su vida. Cristiano Ronaldo es un enamorado de los coches de lujo y ahora quiere imponer una nueva tendencia entre los deportistas millonarios.</span></div>
<div><span style="font-family: Verdana;"><br />
</span></div>
<div><span style="font-family: Verdana;"><img src="/userfiles/image/CR%20jet.jpg" width="630" height="318" border="1" alt="" /></span></div>
